import React from 'react';
import Title from '../../components/Title/Title';
<Title
    titleText={"Gabriel"}
    additionalClass='cor-titulo'
/>

const HomePage = () => {
    return (
        <div>
            <Title
                titleText={"Henrique"}
                additionalClass={'margem-acima'}
                color={'purple'}
            />
        </div>
    );
};

export default HomePage;
